 @Vinicram  Dá para vê que vc não entende muito de futebol.
As defesas dele que vc fala que foi em cima é sempre mérito do goleiro poís um bom posicionamento faz com que a bola venha no rumo do goleiro sendo mais fácil para encaixar doque pular e espalmar, aquela defesa que ele faz com uma mão(esquerda) é super difícil, é uma bola que parece que vai em trajetória dele mais vária para o lado fazendo o goleiro ter pouco tempo de reação é oque chamamos de reflexo, já o soco na bola o goleiro é orientado a dar para ser uma forma de segurança, vc disse que não tinha ninguém ali atrapalhando ele mais vendo de cima é fácil dentro de campo é diferente, tem vários jogadores do lado dele ou seja o goleiro prefere socar a bola nessas horas pois pode haver uma trombada com o jogador do mesmo time fazendo com que caso solte a bola e o adversário fazer o gol não seria falta.
Na proxima vez analisa com detalhes o lance para não dar informação errada, e garanto que vc não pegaria nenhum chute daqueles já que provavelmente não é um cara que pratica futebol.

